import React from "react";

function Project({ project }) {
  return (
    <div className="project-card">
      <a className="project-title link" href={project.github} target="_blank">
        {project.title}
      </a>
      {project.link ? (
        <a className="deploued-link link" href={project.link} target="_blank">
          Click here to visit the site!
        </a>
      ) : null}
      <iframe
        width="560"
        height="315"
        src={project.video}
        title="YouTube video player"
        frameborder="1"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
    </div>
  );
}

export default Project;
